const SVG_PROP_MAP: Record<string, string> = {
    "stroke-width": "strokeWidth",
    "clip-path": "clipPath",
    "fill-opacity": "fillOpacity",
    "stop-color": "stopColor",
    "stop-opacity": "stopOpacity",
};

const normalizeSvgNode = (node: ReactNode): ReactNode => {
    if (!isValidElement(node)) return node;

    const props = (node.props || {}) as Record<string, any>;
    const normalizedProps: Record<string, any> = {};

    Object.entries(props).forEach(([key, value]) => {
        const normalizedKey = SVG_PROP_MAP[key] || key;
        normalizedProps[normalizedKey] = value;
    });

    if (props.children) {
        normalizedProps.children = Children.map(props.children, (child) => normalizeSvgNode(child));
    }

    return createElement(node.type, normalizedProps);
};

const Icon = ({ icon, width, height, fill, ...rest }: PropsType) => {
    return (
        <IconWrapper width={width} height={height} fill={fill} {...rest}>
            {normalizeSvgNode(icons[icon])}
        </IconWrapper>
    )
}

export default Icon;
